import cProfile
import collections
from typing import List, Dict


class Solution:

    def eventualSafeNodes(self, graph: List[List[int]]) -> List[int]:
        
        visited = [False]*len(graph)
        safe = set()

        for i in range(len(graph)):
            if not visited[i]:
                self.depth_first_search(node = i, graph=graph, visited=visited, safe=safe)

        answer = list(safe)
        answer.sort()
        return answer
    
    def depth_first_search(self, node:int, graph:List[List[int]], visited:List[bool], safe:set):
            # visit the node
            visited[node] = True
            # get the neighbors
            adj = graph[node]
            # if there are no neighbors the spot is safe
            if adj == []:
                safe.add(node)
                return True
            
            # if there are neighbors 
            # for each neighbor check if neighbor is safe
            for neighbor in adj:
                # if neighbor has not been visited
                if not visited[neighbor]:
                        # check if neighbor is safe, if the neighbor is not safe, this node is not safe
                        if not self.depth_first_search(node=neighbor, graph=graph, visited=visited, safe=safe):
                             return False
                # if the neighbor has been visited
                else:
                    # if the neighbor is not safe, this node is not safe
                    if not neighbor in safe:
                        return False
            
            # if every neighbor is safe, this node is safe 
            safe.add(node)
            return True


    def eventualSafeNodes2(self, graph: List[List[int]]) -> List[int]:
        new_safe = [0]
        safe_nodes = []
        unsure_nodes = [x for x in range(len(graph))]
        node_safe_dict = collections.defaultdict(bool)
        while new_safe != []:
            new_safe=[]
            nodes_to_remove = []
            for index in range(len(unsure_nodes)):
                paths_to_remove = []
                for path in graph[unsure_nodes[index]]:
                    if node_safe_dict[path] or graph[path] == []:
                        paths_to_remove.append(path)

                for path in paths_to_remove:
                    graph[unsure_nodes[index]].remove(path)
                if graph[unsure_nodes[index]] == []:
                    node_safe_dict[unsure_nodes[index]] = True
                    new_safe.append(unsure_nodes[index])
                    nodes_to_remove.append(index)

            nodes_to_remove.sort()
            for index in nodes_to_remove[::-1]:
                unsure_nodes.pop(index)
            for node in new_safe:
                safe_nodes.append(node)

        safe_nodes.sort()
        return safe_nodes

